async (f) => {
  const filter = {};

  if (f.id_pengajar) {
    filter["t_logbook_participants"] = {
      some: { id_user: parseInt(f.id_pengajar), id_logbook_role: 2 },
    };
  }
  if (f.date) {
    filter["date"] = {
      gt: new Date(moment(f.date).startOf("day").toString()),
      lt: new Date(moment(f.date).add(1, "day").startOf("day").toString()),
    };
  }
  if (f.id_hospital) filter["id_hospital"] = parseInt(f.id_hospital);
  if (f.notes) {
    filter["notes"] = {
      contains: f.notes,
      mode: "insensitive",
    };
  }

  const data = await db.t_logbook.findMany({
    orderBy: { date: "asc" },
    where: {
      id_action: local.m_action.id,
      id_user: user.id,
      ...filter,
    },
    include: {
      t_logbook_status: {
        include: {
          m_user: true,
        },
      },
    },
  });
  return data.map((item) => {
    let staff_pengajar = item.t_logbook_status?.find(
      (o) => o.id_action_role === 10
    )?.m_user?.display_name;
    let peserta = item.t_logbook_status?.find((o) => o.id_action_role === 1)
      ?.m_user?.display_name;
    let admin = item.t_logbook_status?.find((o) => o.id_action_role === 12)
      ?.m_user?.display_name;
    let penguji_1 = item.t_logbook_status?.find((o) => o.id_action_role === 3)
      ?.m_user?.display_name;
    let penguji_2 = item.t_logbook_status?.find((o) => o.id_action_role === 4)
      ?.m_user?.display_name;
    let pembimbing_1 = item.t_logbook_status?.find(
      (o) => o.id_action_role === 2
    )?.m_user?.display_name;
    let pembimbing_2 = item.t_logbook_status?.find(
      (o) => o.id_action_role === 11
    )?.m_user?.display_name;

    return {
      id: item.id,
      date: moment(item.date).format("DD MMMM YYYY - hh:mm"),
      status: item.verified ? "Verified" : "-",
      title: item.title,
      staff_pengajar: staff_pengajar || "",
      peserta: peserta || "",
      admin: admin || "",
      pembimbing_1: pembimbing_1 || "",
      pembimbing_2: pembimbing_2 || "",
      penguji_1: penguji_1 || "",
      penguji_2: penguji_2 || "",
    };
  });
}

